class Credits extends Component {
    render() {
        return (
            <div>
                <h1>Credits</h1>
                <div>
                    {this.props.credits.map( (c) => {
                        return <Credit data={c}/>;
                    })
                    }
                </div>
            </div>
        )
    }
}

export default Credits;
